# Original lists\nlist_a = [['1241000884000', 3], ['1241004212000', 4], ['1241006473000', 11]]\nlist_x = [['1241000884000', 16], ['1241000992000', 16], ['1241001121000', 17], \n          ['1241001545000', 19], ['1241004212000', 20], ['1241006473000', 22]]\n\n# Create a dictionary from list_a for quick lookup\ndict_a = {item[0]: item[1] for item in list_a}\n\n# Merge lists to create list_c\nlist_c = []\nfor datetime, value_x in list_x:\n    if datetime in dict_a:\n        value_a = dict_a[datetime]\n        list_c.append([datetime, value_a / value_x])\n\n# Output the result\nprint(list_c)